import React, { useEffect, useState } from "react";

interface Paciente {
  id: number;
  nome: string;
  idade: number;
  condicao: string;
}

  const PatientList: React.FC = () => {
  const [patients, setPatients] = useState<Paciente[]>([]);

  useEffect(() => {
    // Aqui você fará uma chamada à API para obter a lista de pacientes do backend
    // Por enquanto, vamos usar dados de exemplo
    const pacientesExemplo: Paciente[] = [
      { id: 1, nome: "João Silva", idade: 45, condicao: "Hipertensão" },
      { id: 2, nome: "Maria Santos", idade: 32, condicao: "Diabetes" },
      { id: 3, nome: "José Oliveira", idade: 60, condicao: "Artrite" },
      // Outros pacientes...
    ];
    setPatients(pacientesExemplo);
  }, []);

  return (
    <div>
      <h2>Lista de Pacientes</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Nome</th>
            <th>Idade</th>
            <th>Condição Médica</th>
          </tr>
        </thead>
        <tbody>
          {patients.map((patient) => (
            <tr key={patient.id}>
              <td>{patient.id}</td>
              <td>{patient.nome}</td>
              <td>{patient.idade}</td>
              <td>{patient.condicao}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default PatientList;
